        <div className="text">Sign Up</div>
        <div className="underline"></div>
      </div>
      <div className="inputs">
        <div className="input">
          <img src={account} alt="" />
          <input type="text" />
        </div>
        <div className="input">
          <img src="" alt="" />
          <input type="email" />
        </div>
        <div className="input">
          <img src="" alt="" />
          <input type="password" />
        </div>
      </div>
    </div>
  );
};

export default LoginSignup;
